import './App.css';


function App() {
  const characters = ['Zenyatta', 'Widowmaker'];

  return (
    <div>
      <h1>Overwatch Character Selector</h1>

      {characters.map((character, index) => (
        <label key={index}>{character}</label>
      ))}

      <label>Zenyatta</label>
      <label>Widowmaker</label>
      <label>Juno</label>

    </div>
  );
}

export default App;
